  assemblies:
  - LlamaLogic.Packages
  namespace: LlamaLogic.Packages.Models.ModFileManifest
  summary: "Represents a mod file manifest <xref href=\"LlamaLogic.Packages.ResourceType.SnippetTuning\" data-throw-if-not-resolved=\"false\"></xref> resource (\U0001F513)"
  remarks: >-
    This model allows callers to easily create, read, and update a mod file manifest.

    These manifests are a format sponsored by the Llama Logic team to permit creators to specify the dependency requirements of their mods.


    ### Use in Mod Package (`.package`) files

    When originally creating packages, place one and only one mod file manifest <xref href="LlamaLogic.Packages.ResourceType.SnippetTuning" data-throw-if-not-resolved="false"></xref> resource in the package and use sufficiently unique values for its <xref href="LlamaLogic.Packages.ResourceKey.FullInstance" data-throw-if-not-resolved="false"></xref> and <xref href="LlamaLogic.Packages.Models.ModFileManifest.ModFileManifestModel.TuningName" data-throw-if-not-resolved="false"></xref>.

    If an external application encounters multiple <xref href="LlamaLogic.Packages.ResourceType.SnippetTuning" data-throw-if-not-resolved="false"></xref> manifest resources in a package, it must assume that a manifest un-aware tool has merged multiple manifested packages and process each manifest accordingly.


    Avoid using <xref href="LlamaLogic.Packages.ResourceKey.Group" data-throw-if-not-resolved="false"></xref> `0x00000000` as this is informally reserved for Maxis.

    It would be a bizarre miracle if they started incorporating dependency information using a community format.

    Regardless, let's not make them feel unwelcome and hold their spot for them.


    ### Use in Script Mod Archive (`.ts4script`) files

    Because these files are just ZIP archives with a different extension and their contents are not flatly merged by the game as the contents of package files are, there is no risk of collision.

    Also, since they need not contend with game resource management, they need not be in an arcane format like XML, so they are in YAML instead.

    The static parsing methods of this type expect YAML representations of manifests and the <xref href="LlamaLogic.Packages.Models.ModFileManifest.ModFileManifestModel.ToString" data-throw-if-not-resolved="false"></xref> method produces them.

    Name your mod file manifest resource `llamalogic.modfilemanifest.yml` and put it in the root of your `.ts4script` archive.
